// Generate synthetic data for laser-accelerated ion beams

const targetMaterials = ['aluminium', 'gold', 'polypropylene', 'plastic'];
const targetThicknesses = [5.0, 3000, 10.0, 0.544, 0.266];

// Define the pulse width and energy calculations based on target thickness
const pulseWidthCalculator = (targetThickness) => {
  const q10 = 30; // 10th percentile of pulse width distribution
  const q75 = 279; // 75th percentile of pulse width distribution
  const mean = 291; // mean of pulse width distribution
  const variance = 1030000; // variance of pulse width distribution
  const min = 24; // minimum allowed value for pulse width
  const max = 12900; // maximum allowed value for pulse width

  return Math.random() * (max - min) + min;
};

const energyCalculator = (targetThickness, pulseWidth) => {
  const q10 = 3.55; // 10th percentile of energy distribution
  const q75 = 24.1; // 75th percentile of energy distribution
  const mean = 13.9; // mean of energy distribution
  const variance = 2350; // variance of energy distribution
  const min = 0.302; // minimum allowed value for energy
  const max = 1000; // maximum allowed value for energy

  return Math.random() * (max - min) + min;
};

// Define the spot size and intensity calculations based on energy
const spotSizeCalculator = (energy) => {
  const q10 = 3.3; // 10th percentile of spot size distribution
  const q75 = 3.3; // 75th percentile of spot size distribution
  const mean = 3.61; // mean of spot size distribution
  const variance = 13.7; // variance of spot size distribution
  const min = 2.13; // minimum allowed value for spot size
  const max = 60; // maximum allowed value for spot size

  return Math.random() * (max - min) + min;
};

const intensityCalculator = (energy, spotSize) => {
  const q10 = 4.53e19; // 10th percentile of intensity distribution
  const q75 = 6.83e19; // 75th percentile of intensity distribution
  const mean = 5.10e20; // mean of intensity distribution
  const variance = 3.96e41; // variance of intensity distribution
  const min = 1.05e18; // minimum allowed value for intensity
  const max = 5.59e21; // maximum allowed value for intensity

  return Math.random() * (max - min) + min;
};

// Define the power calculation based on intensity and energy
const powerCalculator = (intensity, energy) => {
  const q10 = 5.59e12; // 10th percentile of power distribution
  const q75 = 7.68e13; // 75th percentile of power distribution
  const mean = 6.23e13; // mean of power distribution
  const variance = 4.03e27; // variance of power distribution
  const min = 1.76e11; // minimum allowed value for power
  const max = 3.83e14; // maximum allowed value for power

  return Math.random() * (max - min) + min;
};

// Define the cutoff energy calculation based on energy and target material
const cutoffEnergyCalculator = (energy, targetMaterial) => {
  const q10 = 4.0; // 10th percentile of cutoff energy distribution
  const q75 = 6.2; // 75th percentile of cutoff energy distribution
  const mean = 8.64; // mean of cutoff energy distribution
  const variance = 156; // variance of cutoff energy distribution
  const min = 3.3; // minimum allowed value for cutoff energy
  const max = 95; // maximum allowed value for cutoff energy

  return Math.random() * (max - min) + min;
};

// Generate 25 new data points
const syntheticData = [];
targetMaterials.forEach((targetMaterial) => {
  targetThicknesses.forEach((targetThickness) => {
    const pulseWidth = pulseWidthCalculator(targetThickness);
    const energy = energyCalculator(targetThickness, pulseWidth);
    const spotSize = spotSizeCalculator(energy);
    const intensity = intensityCalculator(energy, spotSize);
    const power = powerCalculator(intensity, energy);
    const cutoffEnergy = cutoffEnergyCalculator(energy, targetMaterial);

    syntheticData.push({
      target_material: targetMaterial,
      target_thickness: targetThickness,
      pulse_width: pulseWidth,
      energy,
      spot_size: spotSize,
      intensity,
      power,
      cutoff_energy: cutoffEnergy,
    });
  });
});

console.log('Synthetic data for laser-accelerated ion beams:');
console.log(syntheticData);

